import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import {Navbar, Table, TextForm} from './App';
import * as serviceWorker from './serviceWorker';
ReactDOM.render(<Navbar />, document.getElementById('navbar'));

ReactDOM.render(<Table />, document.getElementById('history'));

var addNew = function(){
   var ok = true;

   if (ok === true) {
      var div = document.createElement('div');

      div.id = "#new";
      document.getElementsByTagName('root')[0].appendChild(div);
   }
   ReactDOM.render(<TextForm />, document.getElementById('root'));
}

document.getElementById("#nav").addEventListener('click', addNew);
