var showHist = function(){
   var ok = true;

   if (ok === true) {
      var div = document.createElement('div');

      div.id = "#new";
      document.getElementsByTagName('root')[0].appendChild(div);
   }
   ReactDOM.render(<TextForm />, document.getElementById('root'));
}

document.getElementById("#nav").addEventListener('click', showHist);
